import React from "react";
import axios from "axios";
import './Weather.css';

export default function Weather() {
    return (
        <div className="weather">
        <h1>London, UK</h1>
        <ul>
            <li>Monday, 16:30 </li>
            <li>Rain</li>
        </ul>
        <img src="https://ssl.gstatic.com/onebox/weather/64/rain.png" alt="Rain" />
        </div>
    )
}
